import { Injectable } from '@angular/core';

@Injectable({
  providedIn: 'root'
})
export class SharedService {
  difficulty: string = '';

  setDifficulty(dificultad: string) {
    this.difficulty = dificultad;
  }

  getDifficulty(): string {
    return this.difficulty;
  }
}
